// Importing React and Link component from react-router-dom
import React from 'react';
import { Link } from 'react-router-dom';

// Importing CSS for styling the navbar and logo image
import './PaidNavbar.css';
import logo from './pictures/Emotions_AI_Logo.png'; // Ensure the logo path is correct

// Functional component for the paid navigation bar
const PaidNavbar = () => {
    return (
        <nav className="paid-navbar">
            <div className="paid-navbar-left">
                <Link to="/" className="paid-navbar-logo">
                    <img src={logo} alt="EmotionsAI Logo" style={{ height: '40px' }} />
                    <span>EmotionsAI</span>
                </Link>
            </div>
            <div className="paid-navbar-right">
                <Link to="/transcribe">Transcribe Text</Link>
                <Link to="/transcribe-audio">Transcribe Audio</Link>
                <Link to="/diary">Diary</Link>
                <Link to="/userprofile">UserProfile</Link>
            </div>
        </nav>
    );
}

// Exporting PaidNavbar component for use elsewhere in the application
export default PaidNavbar;
